import React, { useState } from 'react';
import style from "../sass/EditTags.module.scss";

export default function EditTags(props) {

    // State Declarations
    const [tags, setTags] = useState([]);

    function toggleTag(tag)
    {
        if ( tags[tag] === true ) setTags[tag](false);
        else setTags[tag](true);
    }

    const axiosInstance = axios.create({
        withCredentials: true,
    });

    function onSubmit(e)
    {
        axiosInstance
    }

    return (
        <>
            <form className={style.Form} onSubmit={onSubmit}>
                <div className={style.Body}>
                
                    <div className={style.Title}>Editing Tags</div>
                    <div className={style.Stage}>
                        <div className={style.Tags}>
                            <p>Tags</p>
                            <ul>
                                <li><span><i className={`${style.taggedIcon} fas fa-tag`}></i>Residential</span></li>
                                <li><span><i className={`${style.taggedIcon} fas fa-tag`}></i>Commercial</span></li>
                                <li><span><i className={`${style.taggedIcon} fas fa-tag`}></i>Interior</span></li>
                                <li><span><i className={`${style.taggedIcon} fas fa-tag`}></i>Exterior</span></li>
                                <li><span><i className={`${style.taggedIcon} fas fa-tag`}></i>Cabinets</span></li>
                            </ul>
                        </div>
                        <div className={style.ImagePreview}>
                            <img src={props.img} alt="preview"/>
                            <div className={style.Id}>public_id: {props.id}</div>
                        </div>
                    </div>
                    <button className={style.Button} >
                        Confirm
                    </button>
                </div>
            </form>
        </>
    )
}
